  `images` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '图片URL列表（JSON数组）',
  `seat_info` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '座位信息（如\"A区 3排 15号\"）',
  `like_count` int NOT NULL DEFAULT 0 COMMENT '点赞数',
  `is_verified_purchase` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否实名购票',
  `is_deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否删除',
